import React, { useState } from 'react';
import './Grid.css';

const Grid = (props) => {

    const arr = []

    for (let i = 0; i < 200; i++) {
        arr.push(i * 2);
    }

    return (
        <div className="Grid">
            {arr.map((item, index) => <div> {item} </div>)}
        </div>
    )

}

export default Grid;
